import Axios from "axios";
import React, { useEffect, useState } from "react";

interface User {
  id: number;
  name: string;
  scheduled_to: string;
}

function AdminPage() {
  const [users, setUsers] = useState<User[]>([
    {
      id: 0,
      name: "",
      scheduled_to: "",
    },
  ]);

  async function getUsers() {
    const test = await Axios.get("http://localhost:3003/culto");
    console.log(test);
    setUsers(test.data);
  }
  let signedUsers = [<></>];

  useEffect(() => {
    getUsers();
    signedUsers = users.map((user) => <li key={user.id}>{user.name}</li>);
  });

  return (
    <div id="admin-page">
      <div className="content-wrapper">
        <ul>
          <li>Teste</li>
          <li>Teste</li>
          <li>Teste</li>
          <li>Teste</li>
          {signedUsers}
        </ul>
      </div>
    </div>
  );
}

export default AdminPage;
